import React from 'react';
import './ExpenseDate.css';

function ExpenseDate(props) {
  // Check if props.date is a valid Date object
  if (!(props.date instanceof Date) || isNaN(props.date.getTime())) {
    console.error('Invalid date:', props.date);
    return null; // or provide a default value or handle the error as needed
  }

  const options = { year: 'numeric', month: '2-digit', day: '2-digit' };
  const formattedDate = props.date.toLocaleDateString('en-US', options);

  return <div className="expense-date">{formattedDate}</div>;
}

export default ExpenseDate;
